def ChromosomeToCycle(l):
	nodes = []
	for i in range(0, len(l)):
		start = l[i]
		if start > 0:
			nodes.append(2*start - 1)
			nodes.append(2*start)
		else:
			nodes.append(-2*start)
			nodes.append(-2*start - 1)
	return nodes

def CycleToChromosome(nodes):
	l = []
	i = 0
	while i < len(nodes):
		if nodes[i] < nodes[i+1]:
			l.append(nodes[i+1]//2)
		else:
			l.append(-nodes[i+1]//2)
		i += 2
	return l

def ColoredEdges(P):
	edges = []
	for chromosome in P:
		nodes = ChromosomeToCycle(chromosome)
		i = 1
		while i < len(nodes) - 2:
			edges.append((nodes[i], nodes[i+1]))
			i += 2
		edges.append((nodes[len(nodes) - 1], nodes[0]))

	return edges

def GraphToGenome(genome_graph):
	P = []
	i = 0
	while i < len(genome_graph):
		chromosome = []
		tup = genome_graph[i]
		current = tup[0]
		if tup[0]%2 == 0:
			find = tup[0] - 1
		else:
			find = tup[0] + 1
		chromosome.append(current)
		chromosome.append(tup[1])
		i += 1
		while i < len(genome_graph):
			tup = genome_graph[i]
			chromosome.append(tup[0])
			chromosome.append(tup[1])
			i += 1
			if tup[1] == find:
				P.append(chromosome)
				break
	genome = []
	for cycle in P:
		x = cycle.pop()
		cycle = [x] + cycle
		genome.append(Format(CycleToChromosome(cycle)))
	return ''.join(genome)

