def TwoBreakDistance(P, Q):
	edges_P = ColoredEdges(P)
	edges_Q = ColoredEdges(Q)
	if Counter(edges_P) == Counter(edges_Q):
			return 0,'!'
	edges = list(set(edges_P).union(edges_Q))
	#print(edges)
	blocks = len(edges_P)
	#print(blocks)
	#print(NumberOfCycles(edges))
	#print(NumberOfCycles(edges_P, edges_Q))
	return blocks - NumberOfCycles(edges_P, edges_Q)
	#return None

def TwoBreakOnGenomeGraph(genome_graph, i_1, i_2, i_3, i_4):
	if (i_1, i_2) in genome_graph:
		genome_graph.remove((i_1, i_2))
	else:
		genome_graph.remove((i_2, i_1))
	if (i_3, i_4) in genome_graph:
		genome_graph.remove((i_3, i_4))
	else:
		genome_graph.remove((i_4, i_3))
	genome_graph.append((i_1, i_3))
	genome_graph.append((i_2, i_4))
	return genome_graph


